import React from "react";
import Books from "./pages/Books";
import Detail from "./pages/Detail";
import NoMatch from "./pages/NoMatch";
import Nav from "./components/Nav";

function App() {
  return (
  <Router>
    <div>
       <Nav />
      <Switch>
       <Books />
      </Switch>
    </div>
  </Router>
  );
}

export default App;
